import React, { Component } from 'react';
import './App.css';
import Navibar from './components/Navibar/Navibar';
import Content from './components/Content/Content';
import Navi from './components/Navi/Navi';

class App extends Component {
  render(){
    return (
      <div className='App'>
        <Navi/>
        <Navibar/>
        <Content/>
      </div>
    );
  }
}

export default App;
